    false,nt"url": null,nt"notes": "Multibeam backscatter imagery extracted
    from gridded bathymetry of Maro Reef, Northwestern Hawaiian Islands, USA. These
    data provide coverage between 20 and 5000 meters. The backscatter dataset includes
    data collected using Simrad EM300, Simrad EM3002d, Simrad EM120, and Reson 8101
    multibeam sonars. The sonars frequencies are 30 kHz, 300 kHz, 12 kHz, and 240 kHz
    respectively and the backscatter data from each sonar are processed and gridded
    separately. These metadata are for the 1 m grid cell size Simrad em3002d multibeam
    backscatter data only.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
